package com;

public class AttrImpPair {
	
	private String attrName;
	private String imp;
	
	public AttrImpPair(String attrName, String imp) {
		// TODO Auto-generated constructor stub
		this.attrName = attrName;
		this.imp = imp;
	}

	public String getAttrName() {
		return attrName;
	}

	public String getImp() {
		return imp;
	}
	
}
